"""
LeetCode :: June 2021 Challenge :: Number of Matching Subsequences
jramaswami
"""


from collections import defaultdict


class Solution:
    def numMatchingSubseq(self, S, words):
        # For each char is S, make a sorted list of the indices.
        letter_indices = defaultdict(list)
        for i, c in enumerate(S):
            letter_indices[c].append(i)

        def find_index(i, indexes):
            for j in indexes:
                if j > i:
                    return j
            return None

        # Function to see if word is subsequence of S
        def is_subsequence(wd):
            min_index = -1
            for c in wd:
                j = find_index(min_index, letter_indices[c])
                if j is not None:
                    min_index = j
                else:
                    return False
            return True

        return sum(is_subsequence(wd) for wd in words)



def test_1():
    s = "abcde"
    words = ["a","bb","acd","ace"]
    expected = 3
    assert Solution().numMatchingSubseq(s, words) == expected


def test_2():
    s = "dsahjpjauf"
    words = ["ahjpjau","ja","ahbwzgqnuk","tnmlanowax"]
    expected = 2
    assert Solution().numMatchingSubseq(s, words) == expected


